import React from "react";
import Button from '@material-ui/core/Button';
import MainContext from "../../Context/provider/context";
import {useContext, useEffect} from 'react';

var value = '';

function handleChange(event) {
    value = event.target.value
}

const PopUpReserve = props => {
  const {userprofile} = useContext(MainContext).profile;
  return (
    <div className="popup-box">
      <div className="box">
        <span className="close-icon" onClick={props.toggle}>x</span>
        <textarea id="noter-text-area" name="Estimated time" object-fit= "cover" value={value} onChange={handleChange} />
        <Button variant="contained" color="primary" style={{position:'absolute', right:'1%', bottom:'1%'}} onClick={props.toggle}>
				Close
        </Button>
        <Button variant="contained" color="primary" style={{position:'absolute', left:'1%', bottom:'1%'}} onClick={props.toggle}>
				Reserve
        </Button>
      </div>
    </div>
  );
};
 
export default PopUpReserve;
